package assignment04PartD;public class CircularDoublyLinkedDeque<T> implements DequeInterface<T> {    private class DoublyLinkedNode {        private T data;        private DoublyLinkedNode next;        private DoublyLinkedNode previous;        private DoublyLinkedNode(T data) {            this.data = data;            this.next = this.previous = null;        }        private DoublyLinkedNode(DoublyLinkedNode previous, T data, DoublyLinkedNode next) {            this.previous = previous;            this.data = data;            this.next = next;        }        public T getData() {            return data;        }        public void setData(T data) {            this.data = data;        }        public DoublyLinkedNode getNext() {            return next;        }        public void setNext(DoublyLinkedNode next) {            this.next = next;        }        public DoublyLinkedNode getPrevious() {            return previous;        }        public void setPrevious(DoublyLinkedNode previous) {            this.previous = previous;        }    }} // end CircularDoublyLinkedDeque